        }}
/>
             </Switch>
          </div>
        </BrowserRouter>
      );
    }
  }
  catch(e){
    return (
       <div>
            <Route path="/" component={Home}/>
            <Redirect to="/" />
       </div>
    );
  }

  }
}
export default CustomRouting;
